import{_ as l,c as i,o as e,a as t}from"./app.fa011131.js";const g='{"title":"Vue \u5E94\u7528\u6D4B\u8BD5","description":"","frontmatter":{},"headers":[{"level":2,"title":"What \u4EC0\u4E48\u662F\u6D4B\u8BD5","slug":"what-\u4EC0\u4E48\u662F\u6D4B\u8BD5"},{"level":2,"title":"\u524D\u7AEF\u6D4B\u8BD5\u91D1\u5B57\u5854","slug":"\u524D\u7AEF\u6D4B\u8BD5\u91D1\u5B57\u5854"},{"level":2,"title":"\u6D4B\u8BD5\u9A71\u52A8\u5F00\u53D1 TDD","slug":"\u6D4B\u8BD5\u9A71\u52A8\u5F00\u53D1-tdd"},{"level":2,"title":"100% \u4EE3\u7801\u8986\u76D6\u7387\u662F\u8C2C\u8BEF","slug":"_100-\u4EE3\u7801\u8986\u76D6\u7387\u662F\u8C2C\u8BEF"},{"level":2,"title":"\u7EC4\u4EF6\u7684\u5355\u5143\u6D4B\u8BD5","slug":"\u7EC4\u4EF6\u7684\u5355\u5143\u6D4B\u8BD5"},{"level":2,"title":"\u53EF\u7528\u6027\u6D4B\u8BD5(sanity test)","slug":"\u53EF\u7528\u6027\u6D4B\u8BD5-sanity-test"},{"level":2,"title":"vue \u5E94\u7528\u6D4B\u8BD5\u6458\u5F55","slug":"vue-\u5E94\u7528\u6D4B\u8BD5\u6458\u5F55"}],"relativePath":"FE-Engineering/dev-test/index.md"}',a={},s=t('<h1 id="vue-\u5E94\u7528\u6D4B\u8BD5" tabindex="-1">Vue \u5E94\u7528\u6D4B\u8BD5 <a class="header-anchor" href="#vue-\u5E94\u7528\u6D4B\u8BD5" aria-hidden="true">#</a></h1><p>WWHD</p><h2 id="what-\u4EC0\u4E48\u662F\u6D4B\u8BD5" tabindex="-1">What \u4EC0\u4E48\u662F\u6D4B\u8BD5 <a class="header-anchor" href="#what-\u4EC0\u4E48\u662F\u6D4B\u8BD5" aria-hidden="true">#</a></h2><p>\u5E94\u7528\u7A0B\u5E8F\u6D4B\u8BD5\u662F\u6307\u68C0\u67E5\u5E94\u7528\u7A0B\u5E8F\u8FD0\u884C\u8FC7\u7A0B\u662F\u5426\u6B63\u5E38.</p><p>\u6D4B\u8BD5\u7684\u65B9\u6CD5\u4E3B\u8981\u6709\u4E24\u79CD:\u624B\u52A8\u6D4B\u8BD5\u548C\u81EA\u52A8\u5316\u6D4B\u8BD5</p><ul><li>\u624B\u52A8\u6D4B\u8BD5\u662F\u901A\u8FC7\u6D4B\u8BD5\u4EBA\u5458\u4E0E\u5E94\u7528\u7A0B\u5E8F\u7684\u4EA4\u4E92\u64CD\u4F5C\u6765\u68C0\u67E5\u5176\u662F\u5426\u6B63\u5E38\u8FD0\u884C\u7684\u65B9\u6CD5.</li><li>\u81EA\u52A8\u5316\u6D4B\u8BD5\u662F\u7F16\u5199\u6D4B\u8BD5\u4EE3\u7801,\u5229\u7528\u8BA1\u7B97\u673A\u6765\u68C0\u67E5\u5E94\u7528\u7A0B\u5E8F\u662F\u5426\u6B63\u5E38\u8FD0\u884C\u7684\u65B9\u6CD5.\u7B80\u5355\u8BF4,\u5C31\u662F\u5229\u7528\u989D\u5916\u7684\u4EE3\u7801\u6765\u68C0\u67E5\u88AB\u6D4B\u8F6F\u4EF6\u529F\u80FD.</li></ul><p>\u5728\u524D\u7AEF\u9886\u57DF,\u81EA\u52A8\u5316\u6D4B\u8BD5\u7684\u4E09\u79CD\u6D4B\u8BD5\u7C7B\u578B,\u4E5F\u79F0\u4E3A\u524D\u7AEF\u6D4B\u8BD5\u5957\u4EF6:\u5355\u5143\u6D4B\u8BD5/\u5FEB\u7167\u6D4B\u8BD5/\u7AEF\u5230\u7AEF\u6D4B\u8BD5</p><ul><li><p>\u5355\u5143\u6D4B\u8BD5: \u662F\u5BF9\u5E94\u7528\u7A0B\u5E8F\u6700\u5C0F\u5355\u5143\u8FD0\u884C\u6D4B\u8BD5\u7684\u8FC7\u7A0B.\u901A\u5E38,\u6D4B\u8BD5\u7684\u6700\u5C0F\u5355\u5143\u662F<strong>\u51FD\u6570</strong>,\u4F46\u5728\u73B0\u4EE3\u6D41\u884C\u7684\u7EC4\u4EF6\u5316\u524D\u7AEF\u9879\u76EE\u5DE5\u7A0B\u4E2D,<strong>\u7EC4\u4EF6</strong>\u4E5F\u88AB\u89C6\u4E3A\u6D4B\u8BD5\u5355\u5143.</p><ul><li>\u4F18\u70B9: <ul><li>\u6D4B\u8BD5\u8FD0\u884C\u901F\u5EA6\u5FEB</li><li>\u6709\u76F8\u5F53\u4E8E\u7A0B\u5E8F\u6587\u6863\u7684\u529F\u80FD,\u5E2E\u52A9\u65B0\u624B\u5FEB\u901F\u4E86\u89E3\u529F\u80FD\u9700\u6C42.</li></ul></li><li>\u7F3A\u70B9: <ul><li>\u91CD\u6784\u4EE3\u7801\u56F0\u96BE,\u5C06\u4E00\u4E2A\u5DF2\u7ECF\u5177\u5907\u5B8C\u6574\u5355\u5143\u6D4B\u8BD5\u7684\u590D\u6742\u529F\u80FD\u62C6\u5206\u4E3A\u4E24\u4E2A\u5355\u72EC\u7684\u529F\u80FD,\u9700\u8981\u5728\u66F4\u6539\u4EE3\u7801\u7684\u540C\u65F6\u66F4\u6539\u76F8\u5E94\u7684\u5355\u5143\u6D4B\u8BD5.</li><li>\u53EA\u786E\u4FDD\u5355\u5143\u4EE3\u7801\u81EA\u8EAB\u884C\u4E3A\u7B26\u5408\u9884\u671F,\u4F46\u65E0\u6CD5\u4FDD\u8BC1\u5404\u5355\u5143\u4E4B\u95F4\u4EA4\u4E92\u662F\u5426\u6B63\u5E38.\u8FD9\u5C31\u662F\u4E3A\u4EC0\u4E48\u9700\u8981\u7528\u5230\u7AEF\u5230\u7AEF\u6D4B\u8BD5\u7684\u539F\u56E0.</li></ul></li></ul></li><li><p>\u5FEB\u7167\u6D4B\u8BD5: \u76F8\u5F53\u4E8E\u627E\u4E0D\u540C\u6E38\u620F,\u4F1A\u7ED9\u8FD0\u884C\u4E2D\u7684\u7A0B\u5E8F\u62CD\u4E00\u5F20\u56FE\u7247,\u5E76\u5C06\u4E0E\u4EE5\u524D\u4FDD\u5B58\u7684\u56FE\u7247\u8FDB\u884C\u6BD4\u8F83.\u5982\u679C\u56FE\u50CF\u4E0D\u540C,\u5219\u6D4B\u8BD5\u5931\u8D25.</p><ul><li>Jest \u5FEB\u7167\u6D4B\u8BD5\u53EF\u4EE5\u5BF9 JS \u4E2D\u4EFB\u4F55\u53EF\u5E8F\u5217\u5316\u7684\u503C\u8FDB\u884C\u5BF9\u6BD4.</li></ul></li><li><p>\u7AEF\u5230\u7AEF\u6D4B\u8BD5: \u76F8\u5F53\u4E8E\u81EA\u52A8\u6267\u884C\u7684\u624B\u52A8\u6D4B\u8BD5,\u4ECE\u7528\u6237\u7684\u89C6\u89D2\u901A\u8FC7\u6D4F\u89C8\u5668\u6216\u6A21\u62DF\u6D4F\u89C8\u5668\u8F6F\u4EF6\u81EA\u52A8\u68C0\u67E5\u5E94\u7528\u7A0B\u5E8F\u662F\u5426\u6B63\u5E38\u5DE5\u4F5C.</p><ul><li>\u4F18\u70B9:\u51CF\u5C11\u4EBA\u5DE5\u64CD\u4F5C</li><li>\u7F3A\u70B9: <ul><li>\u7AEF\u5230\u7AEF\u6D4B\u8BD5\u8FD0\u884C\u4E0D\u591F\u5FEB:\u53D7\u9650\u4E8E\u6D4F\u89C8\u5668\u542F\u52A8\u65F6\u95F4,\u7F51\u7EDC\u8BF7\u6C42\u54CD\u5E94\u65F6\u95F4\u7B49.</li><li>\u8C03\u8BD5\u56F0\u96BE,\u9700\u8981\u6309\u6253\u5F00\u6D4F\u89C8\u5668\u9010\u6B65\u6309\u7528\u6237\u64CD\u4F5C\u6765\u91CD\u73B0\u95EE\u9898</li><li>flaky \u6D4B\u8BD5,\u5373\u4F7F\u7528\u5E94\u7528\u7A0B\u5E8F\u6B63\u5E38\u8FD0\u884C,\u6D4B\u8BD5\u4ECD\u7136\u53EF\u80FD\u9891\u7E41\u5931\u8D25,\u53EF\u80FD\u539F\u56E0\u662F\u4EE3\u7801\u56E0\u4E3A\u67D0\u4E9B API,\u6216\u8BF7\u6C42\u8D85\u65F6\u7B49\u800C\u5BFC\u81F4\u5931\u8D25.</li></ul></li></ul><blockquote><p>\u53EF\u5E8F\u5217\u5316\u8868\u793A\u4EFB\u4F55\u53EF\u4EE5\u8F6C\u6362\u4E3A\u5B57\u7B26\u4E32\u7136\u540E\u8FD4\u56DE\u503C\u7684\u4EE3\u7801.</p></blockquote></li></ul><h2 id="\u524D\u7AEF\u6D4B\u8BD5\u91D1\u5B57\u5854" tabindex="-1">\u524D\u7AEF\u6D4B\u8BD5\u91D1\u5B57\u5854 <a class="header-anchor" href="#\u524D\u7AEF\u6D4B\u8BD5\u91D1\u5B57\u5854" aria-hidden="true">#</a></h2><ul><li>60%\u5355\u5143\u6D4B\u8BD5</li><li>30%\u5FEB\u7167\u6D4B\u8BD5</li><li>10%\u7AEF\u5230\u7AEF\u6D4B\u8BD5</li></ul><h2 id="\u6D4B\u8BD5\u9A71\u52A8\u5F00\u53D1-tdd" tabindex="-1">\u6D4B\u8BD5\u9A71\u52A8\u5F00\u53D1 TDD <a class="header-anchor" href="#\u6D4B\u8BD5\u9A71\u52A8\u5F00\u53D1-tdd" aria-hidden="true">#</a></h2><p>\u6D4B\u8BD5\u9A71\u52A8\u5F00\u53D1(TDD)\u662F\u4E00\u79CD\u5728\u7F16\u5199\u6E90\u4EE3\u7801\u4E4B\u524D\u5148\u7F16\u5199\u6D4B\u8BD5\u4EE3\u7801\u7684\u5DE5\u4F5C\u6D41\u7A0B.</p><p>\u5373\u5728\u7EC4\u4EF6\u5F00\u53D1\u4E2D\u5728\u7F16\u5199\u7EC4\u4EF6\u4EE3\u7801\u4E4B\u524D,\u5148\u7F16\u5199\u80FD\u591F\u786E\u4FDD\u7EC4\u4EF6\u6B63\u5E38\u8FD0\u884C\u7684\u6D4B\u8BD5\u4EE3\u7801.</p><p><strong>\u7EA2/\u7EFF/\u91CD\u6784</strong>\u662F\u4E00\u79CD\u5F88\u6D41\u884C\u7684 TDD \u65B9\u6CD5.\u7EA2\u4EE3\u8868\u7F16\u5199\u4E00\u4E2A\u4E0D\u80FD\u901A\u8FC7\u7684\u6D4B\u8BD5,\u7136\u540E\u4FEE\u6539\u4EE3\u7801\u8BA9\u6D4B\u8BD5\u901A\u8FC7\u53D8\u7EFF,\u6700\u540E\u901A\u8FC7\u91CD\u6784\u589E\u5F3A\u4EE3\u7801\u53EF\u8BFB\u6027.</p><p>\u4E25\u82DB\u9075\u5B88 TDD(\u5728\u7F16\u5199\u6E90\u4EE3\u7801\u4E4B\u524D\u7F16\u5199\u597D\u6240\u6709\u7684\u6D4B\u8BD5\u4EE3\u7801)\u4F1A\u4E25\u91CD\u51CF\u7F13\u5F00\u53D1\u901F\u5EA6,\u6240\u4EE5\u53EA\u8981\u7F16\u5199\u53EF\u8282\u7701\u65F6\u95F4\u7684,\u6709\u4EF7\u503C\u7684\u6D4B\u8BD5\u4EE3\u7801\u5C31\u53EF\u4EE5,\u7F16\u5199\u5148\u540E\u987A\u5E8F\u65E0\u5173\u7D27\u8981.</p><p>\u4F5C\u8005\u5E38\u7528\u7684 Vue \u7EC4\u4EF6\u5F00\u53D1\u6B65\u9AA4:</p><ol><li>\u786E\u5B9A\u9700\u8981\u7F16\u5199\u7EC4\u4EF6\u9700\u6C42</li><li>\u4E3A\u6BCF\u4E2A\u7EC4\u4EF6\u7F16\u5199\u5355\u5143\u6D4B\u8BD5\u548C\u6E90\u4EE3\u7801,\u5148\u540E\u987A\u5E8F\u81EA\u884C\u51B3\u5B9A</li><li>\u8C03\u6574\u7EC4\u4EF6\u7684\u6837\u5F0F</li><li>\u4E3A\u5DF2\u5B8C\u6210\u7684\u7EC4\u4EF6\u6DFB\u52A0\u5FEB\u7167\u6D4B\u8BD5</li><li>\u5728\u6D4F\u89C8\u5668\u4E2D\u624B\u52A8\u6D4B\u8BD5\u4EE3\u7801</li><li>\u89C6\u9700\u8981\u7F16\u5199\u7AEF\u5230\u7AEF\u6D4B\u8BD5</li></ol><h2 id="_100-\u4EE3\u7801\u8986\u76D6\u7387\u662F\u8C2C\u8BEF" tabindex="-1">100% \u4EE3\u7801\u8986\u76D6\u7387\u662F\u8C2C\u8BEF <a class="header-anchor" href="#_100-\u4EE3\u7801\u8986\u76D6\u7387\u662F\u8C2C\u8BEF" aria-hidden="true">#</a></h2><p>\u4EE3\u7801\u8986\u76D6\u7387\u662F\u5EA6\u91CF\u81EA\u52A8\u5316\u6D4B\u8BD5\u8FD0\u884C\u4EE3\u7801\u5E93\u4EE3\u7801\u884C\u6570\u7684\u4E00\u4E2A\u6307\u6807.</p><ul><li>100% \u4EE3\u7801\u8986\u76D6\u7387\u610F\u5473\u7740\u6267\u884C\u6D4B\u8BD5\u671F\u95F4\u6BCF\u884C\u4EE3\u7801\u90FD\u4F1A\u88AB\u8FD0\u884C</li><li>0% \u4EE3\u7801\u8986\u76D6\u7387\u610F\u5473\u7740\u672A\u6267\u884C\u4EFB\u4F55\u4EE3\u7801</li></ul><p>\u4E0D\u5FC5\u6267\u7740\u4E8E\u8BA9\u5E94\u7528\u7A0B\u5E8F\u5B9E\u73B0 100% \u4EE3\u7801\u8986\u76D6\u7387,\u5B83\u4F1A\u8BA9\u4F60\u50CF\u62E7\u5E72\u6E7F\u6BDB\u5DFE\u7684\u6700\u540E\u4E00\u6EF4\u6C34\u4E00\u6837\u8F9B\u82E6,\u53EA\u9700\u8981\u5B8C\u6210\u5E94\u7528\u7684\u6838\u5FC3\u529F\u80FD\u6D4B\u8BD5\u5373\u53EF.</p><h2 id="\u7EC4\u4EF6\u7684\u5355\u5143\u6D4B\u8BD5" tabindex="-1">\u7EC4\u4EF6\u7684\u5355\u5143\u6D4B\u8BD5 <a class="header-anchor" href="#\u7EC4\u4EF6\u7684\u5355\u5143\u6D4B\u8BD5" aria-hidden="true">#</a></h2><p>\u5BF9\u7EC4\u4EF6\u786E\u5B9A\u7F16\u5199\u54EA\u4E9B\u5355\u5143\u6D4B\u8BD5\u662F\u975E\u5E38\u91CD\u8981\u7684,\u5982\u679C\u4E3A\u7EC4\u4EF6\u7684\u6BCF\u4E2A\u5C5E\u6027\u90FD\u7F16\u5199\u6D4B\u8BD5,\u5C06\u4F1A\u521B\u5EFA\u51FA\u4E00\u4E2A\u4F4E\u6548\u7684,\u51CF\u7F13\u5F00\u53D1\u901F\u5EA6\u7684\u6D4B\u8BD5\u5957\u4EF6.</p><p>\u80FD\u591F\u5E2E\u52A9\u6211\u4EEC\u51B3\u5B9A\u5982\u4F55\u6D4B\u8BD5\u7EC4\u4EF6\u7684\u4E00\u79CD\u65B9\u6CD5\u662F\u9075\u5FAA\u4F7F\u7528<strong>\u7EC4\u4EF6\u5951\u7EA6</strong>\u7684\u6982\u5FF5:<strong>\u63D0\u4F9B\u6B63\u786E\u7684\u8F93\u5165,\u8BE5\u7EC4\u4EF6\u5C06\u4EA7\u751F\u7EA6\u5B9A\u7684\u8F93\u51FA</strong>.</p><p>Vue \u7EC4\u4EF6\u5E38\u89C1\u7684\u8F93\u5165:</p><ul><li>\u7EC4\u4EF6\u4E2D\u7684 props</li><li>\u7528\u6237\u64CD\u4F5C(\u5982\u70B9\u51FB\u6309\u94AE)</li><li>\u5B50\u7EC4\u4EF6\u4E8B\u4EF6\u786E\u53D1</li><li>Vuex Store \u4E2D\u7684\u6570\u636E</li></ul><p>\u5E38\u89C1\u7684\u8F93\u51FA:</p><ul><li>\u6E32\u67D3\u51FD\u6570\u751F\u6210\u7684 DOM \u8282\u70B9</li><li>\u53D1\u5C04\u51FA\u7684\u4E8B\u4EF6</li><li>\u5916\u90E8\u51FD\u6570\u7684\u8C03\u7528</li></ul><h2 id="\u53EF\u7528\u6027\u6D4B\u8BD5-sanity-test" tabindex="-1">\u53EF\u7528\u6027\u6D4B\u8BD5(sanity test) <a class="header-anchor" href="#\u53EF\u7528\u6027\u6D4B\u8BD5-sanity-test" aria-hidden="true">#</a></h2><p>\u642D\u5EFA\u6D4B\u8BD5\u7CFB\u7EDF\u7684\u7B2C\u4E00\u6B65\u662F\u7F16\u5199\u4E00\u4E2A\u7B80\u5355\u7684\u6D4B\u8BD5\u6765\u68C0\u67E5\u7CFB\u7EDF\u662F\u5426\u8BBE\u7F6E\u6B63\u5E38,\u8FD9\u4E2A\u6D4B\u8BD5\u5C31\u79F0\u4E3A\u53EF\u7528\u6027\u6D4B\u8BD5(sanity test).</p><h2 id="vue-\u5E94\u7528\u6D4B\u8BD5\u6458\u5F55" tabindex="-1">vue \u5E94\u7528\u6D4B\u8BD5\u6458\u5F55 <a class="header-anchor" href="#vue-\u5E94\u7528\u6D4B\u8BD5\u6458\u5F55" aria-hidden="true">#</a></h2><blockquote><p><code>&lt;&lt;vue.js \u5E94\u7528\u6D4B\u8BD5&gt;&gt;</code></p></blockquote><ol><li>\u6D4B\u8BD5\u662F\u6709\u5173\u8F93\u5165\u548C\u8F93\u51FA\u7684\uFF0C\u5728\u6D4B\u8BD5\u4E2D\uFF0C\u4F60\u63D0\u4F9B\u8F93\u5165\uFF0C\u63A5\u6536\u8F93\u51FA\uFF0C\u5E76\u65AD\u8A00\u8F93\u51FA\u662F\u5426\u6B63\u786E\u7684\u8FC7\u7A0B\u3002P40</li><li>\u7AEF\u5230\u7AEF\u6D4B\u8BD5\u662F\u5229\u7528\u7A0B\u5E8F\u81EA\u52A8\u6267\u884C\u7684\u90A3\u4E9B\u539F\u672C\u624B\u52A8\u6D4B\u8BD5\u7684\u5185\u5BB9\u3002\u5B83\u5E76\u4E0D\u662F\u4E00\u79CD\u65B0\u7684\u6D4B\u8BD5\u4EE3\u7801\u7684\u65B9\u6CD5\uFF0C\u53EA\u662F\u5229\u7528\u7A0B\u5E8F\u52A0\u5FEB\u4E86\u624B\u52A8\u6D4B\u8BD5\u7684\u6267\u884C\u901F\u5EA6\u3002\u800C\u5355\u5143\u6D4B\u8BD5\u662F\u4E00\u79CD\u4E0D\u540C\u4E8E\u624B\u52A8\u6D4B\u8BD5\u4EE3\u7801\u7684\u65B0\u65B9\u6CD5\u3002P6</li><li>\u5355\u5143\u6D4B\u8BD5\u662F\u5BF9\u5E94\u7528\u7A0B\u5E8F\u6700\u5C0F\u7684\u90E8\u5206\uFF08\u5355\u5143\uFF09\u8FD0\u884C\u6D4B\u8BD5\u7684\u8FC7\u7A0B\u3002\u901A\u5E38\u5E94\u7528\u7A0B\u5E8F\u6700\u5C0F\u5355\u5143\u662F\u51FD\u6570\uFF0C\u5728\u73B0\u4EE3\u7EC4\u4EF6\u5316\u524D\u7AEF\u5F00\u53D1\u4E2D\uFF0C\u7EC4\u4EF6\u4E5F\u662F\u88AB\u6D4B\u5355\u5143\u3002P6</li><li>\u5FEB\u7167\u6D4B\u8BD5\u7C7B\u578B\u4E8E\u201C\u627E\u4E0D\u540C\u201D\u7684\u6E38\u620F\u3002\u5FEB\u7167\u6D4B\u8BD5\u4F1A\u7ED9\u8FD0\u884C\u4E2D\u7684\u5E94\u7528\u7A0B\u5E8F\u62CD\u4E00\u5F20\u56FE\u7247\uFF0C\u5E76\u5C06\u5176\u4E0E\u4EE5\u524D\u4FDD\u5B58\u7684\u56FE\u7247\u8FDB\u884C\u6BD4\u8F83\uFF0C\u5982\u679C\u56FE\u50CF\u6709\u4EC0\u4E48\u4E0D\u540C\uFF0C\u5219\u6D4B\u8BD5\u5931\u8D25\u3002P7</li><li>\u4F20\u7EDF\u5FEB\u7167\u6D4B\u8BD5\u662F\u5728\u6D4F\u89C8\u5668\u4E2D\u542F\u52A8\u5E94\u7528\u7A0B\u5E8F\u5E76\u83B7\u53D6\u6E32\u67D3\u9875\u9762\u7684\u5C4F\u5E55\u622A\u56FE\u8FDB\u884C\u6BD4\u8F83\uFF0Cjest \u5FEB\u7167\u6D4B\u8BD5\u53EF\u4EE5\u5BF9 javascript \u4E2D\u4EFB\u4F55\u53EF\u5E8F\u5217\u5316\u7684\u503C\u8FDB\u884C\u6BD4\u8F83\u3002P7</li><li>\u524D\u7AEF\u5E94\u7528\u7A0B\u5E8F\u6D4B\u8BD5\u5957\u4EF6\u7684\u7EC4\u6210\u7684\u5408\u7406\u6BD4\u8F83\uFF1A\u5355\u5143\u6D4B\u8BD5 60%\uFF0C\u5FEB\u7167\u6D4B\u8BD5 30%\uFF0C\u7AEF\u5230\u7AEF\u6D4B\u8BD5 10%\u3002P8</li><li>\u53EF\u7528\u6027\u6D4B\u8BD5(sanity test)\uFF1A\u662F\u7F16\u5199\u4E00\u4E2A\u7B80\u5355\u7684\u6D4B\u8BD5\u6765\u68C0\u67E5\u642D\u5EFA\u7684\u6D4B\u8BD5\u73AF\u5883\u662F\u5426\u53EF\u7528\u3002P24</li><li>describe \u51FD\u6570\u5C06\u4E00\u7EC4\u5355\u5143\u6D4B\u8BD5\u5B9A\u4E49\u4E3A\u4E00\u4E2A\u6D4B\u8BD5\u5957\u4EF6\uFF08suites)\u3002\u4F7F\u7528 describe \u51FD\u6570\u7EC4\u7EC7\u5355\u5143\u6D4B\u8BD5\uFF0C\u5C31\u50CF\u7528\u5206\u9694\u677F\u5BF9\u6587\u4EF6\u67DC\u91CC\u7684\u6587\u4EF6\u8FDB\u884C\u9694\u79BB\u5206\u7C7B\u4E00\u6837\uFF0C\u80FD\u591F\u5C06\u6587\u4EF6\u5F52\u6863\u5230\u6B63\u5E38\u7684\u7C7B\u578B\uFF0C\u4E95\u4E95\u6709\u6761\uFF0C\u4F46\u5E94\u8BE5\u907F\u514D\u8FC7\u91CF\u7684\u5D4C\u5957 describe \u51FD\u6570\uFF0C\u8BA9\u4EBA\u8FF7\u5931\u3002P29</li><li>\u9700\u6C42\u662F\u4ECE\u7528\u6237\u7684\u89C6\u89D2\u5BF9\u5E94\u7528\u7A0B\u5E8F\u8FDB\u884C\u7684<strong>\u6A21\u7CCA\u63CF\u8FF0</strong>\u3002P41</li><li>\u521B\u5EFA\u7EC4\u4EF6\u6D4B\u8BD5\u89C4\u8303\u7684\u6B65\u9AA4\uFF1A\u62FF\u5230\u9700\u6C42 =\u300B \u660E\u786E\u9700\u6C42\uFF08\u9AD8\u7EA7\u89C4\u8303\uFF09 =\u300B \u5206\u89E3\u6210\u7EC4\u4EF6\u89C4\u8303 P41 <ul><li>\u591A\u65B9\u5C31\u9700\u6C42\u8FBE\u6210\u4E00\u81F4</li><li>\u660E\u786E\u9700\u6C42\uFF1A\u56DE\u7B54\u6709\u5173\u7EC6\u8282\u7684\u95EE\u9898\uFF0C\u4EE5\u5F97\u5230\u9AD8\u7EA7\u89C4\u8303\u4E0E\u8BBE\u8BA1\uFF0C\u5982 UI \u56FE</li><li>\u5C06 UI \u8BBE\u8BA1\u7684\u7EC4\u4EF6\u7ED3\u6784\u8FDB\u884C\u62C6\u89E3\u6210\u7EC4\u4EF6\u5355\u4F4D</li><li>\u5C06\u660E\u786E\u7684\u9700\u6C42\uFF0C\u5373\u5F97\u5230\u7684\u9AD8\u7EA7\u89C4\u8303\u5206\u89E3\u6210\u7EC4\u4EF6\u89C4\u8303</li></ul></li><li>\u4E00\u4E2A\u597D\u7684\u5355\u5143\u6D4B\u8BD5\u8981\u6709\u4E00\u4E2A\u5BCC\u6709\u8868\u8FBE\u529B\u7684\u65AD\u8A00 P49</li><li>\u8026\u5408\u662F\u6307\u4EE3\u7801\u6A21\u5757\u4E4B\u95F4\u7684\u76F8\u4E92\u4F9D\u8D56\u3002P56</li></ol>',33),r=[s];function d(n,u,h,o,p,c){return e(),i("div",null,r)}var v=l(a,[["render",d]]);export{g as __pageData,v as default};
